import React from 'react';
import {Signup} from "./components/signup";
import {Signin} from "./components/signin"
import Wave from "react-wavify";
import './App.css'
import {
    BrowserRouter as Router,
    Route,
    Routes
} from "react-router-dom";

function App() {
  return (
      <Router>
          <Routes>
              <Route path="/">
                  <Signin/>
              </Route>
              <Route path="/signup">
                  <Signup/>
              </Route>
          </Routes>
      </Router>
  );
}

export default App;
